import React, { Component } from 'react';

import "./TopCocktail.scss"

class TopCocktail extends Component {
  render() {
    return (
      <div className="TopCocktail">
        <h2>TopCocktail</h2>
      </div>
    );
  }
}

export default TopCocktail;
